import React from "react";
import Header from "./Header";
import Note from "./Note.jsx"
import Footer from "./Footer";

import notes from "../notes.js";



function App() {
    return(
        <div>
        <Header />
        {notes.map( createNotes => (
            <Note 
            key={noteItem.key}
            name = {createNotes.name}
            content = {createNotes.content}
            />)
        )}
        <Footer />

        </div>
    );
}

export default App;
